{% block extrafooter %}
    <script>
        var \$flash = null;

        function saveFlash() {
            \$flash = \$('[data-flash-messages]').children();
        }

        function setFlashAndProgress() {
            var \$newProgress = \$('[data-ajax-refresh-target] > [data-progress-bar]');
            if (\$newProgress.length) {
